script: |
  super -f text -I q2553.spq | sort > q2553.out

inputs:
  - name: q2553.spq
    data: |
      SELECT DISTINCT + - col2 - - col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE + ( - col0 ) BETWEEN ( + col2 ) AND 17 * - + 14 * col2 * + 65 + + col1;
  - name: tab1

outputs:
  - name: q2553.out
    data: |
